import React, { useState } from "react";
import "../dashboard.css";

const Dashboard = ({ user, handleLogout }) => {
  const [tasks, setTasks] = useState([]);
  const [newTask, setNewTask] = useState("");

  const addTask = () => {
    if (newTask.trim() !== "") {
      setTasks([...tasks, { id: Date.now(), name: newTask, done: false }]);
      setNewTask("");
    }
  };

  const deleteTask = (id) => {
    setTasks(tasks.filter(task => task.id !== id));
  };

  const toggleDone = (id) => {
    setTasks(tasks.map(task => task.id === id ? { ...task, done: !task.done } : task));
  };

  const editTask = (id) => {
    const editedTask = prompt("Edit your task:");
    if (editedTask) {
      setTasks(tasks.map(task => task.id === id ? { ...task, name: editedTask } : task));
    }
  };

  const doneCount = tasks.filter(task => task.done).length;
  const progress = tasks.length ? Math.round((doneCount / tasks.length) * 100) : 0;

  return (
    <div className="dashboard">
      <div className="sidebar">
        <h2>Admin Panel</h2>
        <ul>
          <li>Dashboard</li>
          <li>Tasks</li>
          <li>Settings</li>
        </ul>
      </div>

      <div className="main">
        <div className="topbar">
          <h3>Welcome, {user}</h3>
          <button onClick={handleLogout} className="logout-btn">Logout</button>
        </div>

        <div className="content">
          <div className="task-input">
            <input 
              type="text" 
              placeholder="Add a new task..." 
              value={newTask} 
              onChange={(e) => setNewTask(e.target.value)} 
            />
            <button onClick={addTask}>Add Task</button>
          </div>

          <div className="task-table">
            <h3>Tasks</h3>
            <table>
              <thead>
                <tr>
                  <th>Task</th>
                  <th>Status</th>
                  <th>Actions</th>
                </tr>
              </thead>
              <tbody>
                {tasks.map(task => (
                  <tr key={task.id}>
                    <td>{task.name}</td>
                    <td>{task.done ? "Done" : "Not Done"}</td>
                    <td>
                      <button onClick={() => toggleDone(task.id)}>Toggle</button>
                      <button onClick={() => editTask(task.id)}>Edit</button>
                      <button onClick={() => deleteTask(task.id)}>Delete</button>
                    </td>
                  </tr>
                ))}
              </tbody>
            </table>
          </div>

          <div className="progress-circle">
            <svg viewBox="0 0 36 36">
              <path
                className="circle-bg"
                d="M18 2.0845
                  a 15.9155 15.9155 0 0 1 0 31.831
                  a 15.9155 15.9155 0 0 1 0 -31.831"
              />
              <path
                className="circle"
                strokeDasharray={`${progress}, 100`}
                d="M18 2.0845
                  a 15.9155 15.9155 0 0 1 0 31.831
                  a 15.9155 15.9155 0 0 1 0 -31.831"
              />
              <text x="18" y="20.35" className="percentage">{progress}%</text>
            </svg>
            <p>Tasks Completed</p>
          </div>
        </div>
      </div>
    </div>
  );
};

export default Dashboard;
